import { Box, Typography } from "@mui/material";

const OrderHeader = ({ pageNumber }) => {
  return (
    <>
      {[1, 2, 3].map((it) => (
        <Box
          display="flex"
          flexDirection="column"
          alignItems="center"
          key={it}
          mx={8}
        >
          <Box
            display="flex"
            flexDirection="column"
            alignItems="center"
            justifyContent="center"
            sx={{
              width: "40px",
              height: "40px",
              borderRadius: "50%",
            }}
            my={2}
            bgcolor={it === pageNumber ? "#f5d62f" : "#b6b6b6ff"}
          >
            <Typography fontWeight="800">{it}</Typography>
          </Box>
          <Box
            display="flex"
            flexDirection="column"
            alignItems="center"
            justifyContent="center"
            sx={{ width: "100px" }}
            bgcolor={it === pageNumber ? "#f5d62f" : "#b6b6b6ff"}
          >
            <Typography fontWeight="800">{it}</Typography>
          </Box>
        </Box>
      ))}
    </>
  );
};

export default OrderHeader;

OrderHeader.defaultProps = {
  pageNumber: 1,
};
